```
CREATE PRODUCT intecmar_2 USING 4326;

CREATE SPATIAL DIMENSION Estuary (
    geometry: Polygon
) WITH PROPERTIES (
    shortName String,
    name String,
    zone String
);

CREATE CATEGORICAL DIMENSION Depth (
    FIELD: depthRange
);

CREATE RANGE surface FROM 0 TO 3;
CREATE RANGE 5m FROM 4.75 TO 5.25;
CREATE RANGE 10m FROM 9.75 TO 10.25;
CREATE RANGE 15m FROM 14.75 TO 15.25;
CREATE RANGE 20m FROM 19.75 TO 20.25;

CREATE CATEGORICAL DIMENSION alarm (
    FIELD: alarmLevel
);

CREATE SENSOR StationObservation USING 4326 WITH PROPERTIES (
    maxDepth Float,
    code String,
    name String,
    description String,
    startTime DateTime,
    endTime DateTime
) WITH MEASUREMENT DATA (
    temperature_ITS90 Double UNITS 'ºC' ICON 'thermometer-low',
    salinity Double UNITS 'PSU',
    pressure Double UNITS 'dbar' ICON 'speedometer',
    ph Double UNITS 'ph' ICON 'ph',
    oxygen Double UNITS 'mg/l' ICON 'gas-cylinder',
    transmittance Double UNITS 'm',
    irradiance Double UNITS 'W/m2',
    uv_flourescence Double UNITS 'mg/m3',
    density Double UNITS 'kg/m3',
    conductivity Double UNITS 'S/m'
) WITH SPATIAL GROUP Estuary (
    estuary1,
    estuary2
) WITH CATEGORICAL GROUP Depth (
    surface RANGE surface,
    5m RANGE 5m,
    10m RANGE 10m,
    15m RANGE 15m,
    20m RANGE 20m
) WITH CATEGORICAL GROUP alarm (
    low,
    medium,
    high
) WITH BBOX ([42.7, -8.1], 9);
```

